var simon =
{
	getRssFeed : function(){
		var rssUrl = full_theme_path + "/functions/cache.php";

		//clear the content in the div for the next feed.
		$("#blogroll").empty();
		$("#blogroll").append("<div class=\"status\">Loading...</div>");
		//use the JQuery to put the results in to an argument for parsing in the inline 
		//function called when the feed retrieval is complete
		$.get(rssUrl, function(d) {
			$("#blogroll").empty();
	 
			var totalHtml = "";
			//find each 'item' in the file and parse it
			$(d).find("item").each(function() {
				var cssClass = "rotated";
				//name the current found item this for this particular loop run
				var $item = $(this);
				// grab the post title
				var title = $item.find("title").text();
				// grab the post's URL
				// the link is correctly in find("link").text(); because now the content type of the RSS is correct
				var link = $item.find("link").text();
				// get post category
				var category = $item.find("category").text();

				var html = "<div class=\"" + cssClass + "\">"
				  + "<a href=\"" + link + "\""
					+ " title=\"" + category + ": " + title + "\">"
					 + title
					+ "</a></div>"; 
				totalHtml += html;
			});

			// Repeat the list of items to get at least 90 items
			var items = $(d).find("item").length;
			if( items > 0 )
			{
				var repeats = Math.ceil( 90 / items );
				for( var i = 0; i < repeats; i++ )
				{
					// Print the items to the screen
					$("#blogroll").append($(totalHtml));
				}
			}
		});
	},
	addStyleFile : function( filename )
	{
		var path = Drupal.settings.basePath + "themes/simon/style/" + filename;
		var fileref = document.createElement("link");
		fileref.setAttribute("rel", "stylesheet");
		fileref.setAttribute("type", "text/css");
		fileref.setAttribute("href", path);
		document.getElementsByTagName("head")[0].appendChild(fileref);
	},
	isIe : function(){
		var htmlNode = document.getElementsByTagName("html");
		return htmlNode[0].className.indexOf("ie") > -1;
	}
};

/********* Start Initialization ************/
// Initialize W3C Template Layout with jQuery
if( !simon.isIe() ) {
	$.templateLayoutShowOnReady();
}

$(function() {
	if( !simon.isIe() ) {
		$.setTemplateLayout( full_theme_path + "/style/position.css" );
	}
});
/********* End Initialization ************/
